&lt;&lt;정형식 조한창 김복형 등....!!! 헌법을 수호하라!! 헙법재판소는 헌법에만 근거하여 8:0파면 선고 내려라!!&gt;&gt;
 문형배, 이미선 재판과 임기끝나는 4월 18일까지 뻗치기 한다면 국민이 믿었던 최후의 보루 헌재 재판관도 내란동조, 협조, 내란수괴 윤석열에게 계엄 자유이용권을 주고, 노상원 수첩의 끔찍한 범행을 허락해주는 것!!! 
&lt;헌재는 이 번 주 파면선고&gt;로 국정혼란을 막고 다시 살아나는 내란의 불길을 끄고 내란범들이 무너뜨린 헌법수호의지, 민주주의, 법치주의를 회복시키고 민주시민이 더 이상 피를 흘리지 않게 하라!!!
